import React from "react";
import { FlowerOptions } from "./FlowerOptions";

export const FlowerChoosingBouquet = ({ cartvalue }) => {
  return (
    <div id="ChoosingFlowers">
      <h2>Choose the bouquet:</h2>
      <section className="ChoosingFlowers__container">
        <FlowerOptions cartvalue={cartvalue} />
      </section>
    </div>
  );
};
